import { List } from "antd";
import React, { Component } from "react";

export default class TodoList extends Component {
  render() {
    return (
      <List
        size="large"
        dataSource={this.props.yodoList}
        renderItem={(item) => <List.Item>{item}</List.Item>}
      />
    );
  }
}

